css:
.atom-debugger {
  padding: 5px;
}
.atom-debugger .header {
  padding: 2.5px 5px;
}
.atom-debugger .header-item {
  display: inline-block;
  margin: 2.5px 0;
}
.atom-debugger .sub-title {
  padding-left: 10px;
  color: rgba(157, 165, 180, 0.6);
}
.atom-debugger .checkbox {
  padding-left: 2.25em;
}
.atom-debugger .checkbox input[type="checkbox"] {
  display: inline-block;
  font-size: inherit;
  position: relative;
  width: 1.5em;
  height: 1.5em;
  margin: 0 0 0 -2.25em;
  border-radius: 3px;
}
.atom-debugger .checkbox .checkbox-label {
  -webkit-user-select: none;
  display: inline-block;
  font-size: 1.2em;
}
.atom-debugger.stopped {
  cursor: '';
}
.atom-debugger.running {
  cursor: wait;
}
